INSERT INTO `goods_goodsinfo` VALUES (28, '活着', '闲置书籍', '2.jpg', 20.00, 0, '中快食堂', '《活着》是作家余华的代表作之一，讲述了在大时代背景下，随着内战、三反五反、大跃进、文化大革命等社会变革', 1, '2022-02-22 00:00:00', 1);
INSERT INTO `goods_goodsinfo` VALUES (29, '索尼相机', '数码电子', '2.jpg', 699.00, 0, '中快食堂', '索尼照相机也是索尼公司的优质产品之一，索尼照相机走的是高端时尚前卫路线，CCD技术先进， 便携中的高像素，防抖，自动捕捉头像，而且索尼照相机还支持笑脸快门，可以捕捉精彩的一瞬间。', 1, '2022-02-22 22:14:18', 1);
INSERT INTO `goods_goodsinfo` VALUES (30, '女装', '鞋服佩饰', '1.jpg', 199.00, 0, '中快食堂', '旧衣服', 1, '2022-02-22 22:14:22', 1);
INSERT INTO `goods_goodsinfo` VALUES (31, '茶杯', '日用物品', '3.jpg', 29.00, 0, '翰林食堂', '茶杯', 1, '2022-02-22 22:14:25', 1);
INSERT INTO `goods_goodsinfo` VALUES (32, '自行车', '出行交通', '3.jpg', 150.00, 0, '祥云体育场', '自行车', 1, '2022-02-22 22:14:28', 1);
INSERT INTO `goods_goodsinfo` VALUES (33, '雨伞', '其他闲置', '4.jpg', 99.00, 0, '中快食堂', '天堂雨伞', 1, '2022-02-22 22:14:31', 1);
INSERT INTO `goods_goodsinfo` VALUES (35, '基督山伯爵', '闲置书籍', '1645439437.855844.jpg', 50.00, 0, '中快食堂', '《基督山伯爵》是法国作家大仲马创作的长篇小说，首次发表于1844—1846年。\r\n故事讲述19世纪法国皇帝拿破仑“百日王朝”时期，法老号大副爱德蒙·唐泰斯受船长委托，为拿破仑党人送了一封信，遭到两个卑鄙小人和法官的陷害，被打入黑牢。期间狱友法利亚神甫向他传授各种知识，并在临终前把埋于基督山岛上的一批宝藏的秘密告诉了他。被陷害入狱十四年后，唐泰斯越狱后找到了宝藏，成为巨富，从此化名基督山伯爵（水手辛巴德、布索尼神父、威尔莫勋爵），经过精心策划，报答了恩人，惩罚了仇人。\r\n', 17, '2022-02-22 22:14:34', 1);
INSERT INTO `goods_goodsinfo` VALUES (36, '深入理解计算机系统', '闲置书籍', '1645443274.4606478.jpg', 80.00, 0, '翰林食堂二楼', '《深入理解计算机系统》 [4]  是理解计算机系统首选书目，是10余万程序员的共同选择。卡内基-梅隆、北京大学、清华大学、上海交通大学等国内外众多知名高校选用指定教材。从程序员视角全面剖析的实现细节，使读者深刻理解程序的行为，将所有计算机系统的相关知识融会贯通。', 17, '2022-02-22 22:14:36', 1);
INSERT INTO `goods_goodsinfo` VALUES (37, '台灯', '数码电子', '1645540608.4259095.jpg', 30.00, 0, '翰林食堂一楼', '台灯，一般指放在桌子上用的有底座的电灯， [1]  但随着科技的进步，台灯的外观、造型也在不断地发展，并逐渐出现了能够吸附在任意位置的磁吸式台灯，其小巧精致，方便携带。台灯的作用主要是照明，便于阅读、学习、工作等，台灯已经远远超越了其本身的价值，甚至已经变成了一个艺术品。', 1, '2022-02-21 16:00:00', 1);
INSERT INTO `goods_goodsinfo` VALUES (38, 'iphone13', '数码电子', '1645889166.9352489.jpg', 6999.00, 0, '中快食堂', 'iPhone 13是美国苹果公司于北京时间2021年9月15日凌晨1点在Apple Park发布的iPhone手机。 [6] \r\niPhone 13屏幕采用6.1英寸OLED屏幕；高度约146.7毫米，宽度约71.5毫米，厚度约7.65毫米，重量约173克。配有红色、星光色、午夜色、蓝色、粉色五种颜色。 [8] \r\n', 17, '2022-02-25 16:00:00', 1);

